article:
Andmeviimistlus on andmete ülekanne ühest andmebaasist teise, kas sellega seotud süsteemide vahel või erinevate süsteemide vahel. Andmeviimistlust kasutatakse tavaliselt andmeid üle kantakse ühest süsteemist teise, et säilitada andmete koondamine ning tagada andmete integriteet.

##Sissejuhatus

Andmeviimistlus on oluline tehnoloogia, mis lubab andmeid üle kantakse erinevate süsteemide vahel. Andmeviimistlust kasutatakse erinevate äriprotsesside - tõlkimine, maksumaksujärjestused, maksustamine, teenused jne tootevastutuseks. Andmeviimistlust on kasutatud ka hooldus-, teenindus- ning energiakasutuse andmeid. Andmeviimistlus võimaldab ka võimaldab võtta vastutus üle riikidevahelisel tasandil.

##Andmete viimistlemise eesmärgid

Andmete viimistlemise eesmärgid on:

- Andmeid üle kantakse ühest süsteemist teise;
- Andmeid üle kantakse erinevate süsteemide vahel;
- Andmed on ühtlustatud;
- Andmete integriteet on tagatud;
- Andmete säilitamine;
- Andmete koondamine.

##Andmete viimistlemise sammud

Andmete viimistlemise sammud on:

- Kõrgtasemeline; 
- Võrgu tasemeline;
- Kõrgekvaliteediline;
- Tarkvara tasemeline;
- Manuaalne.

###Kõrgtasemeline andmeviimistlus

Kõrgtasemeline andmeviimistlus on andmeid üle kantakse ühest süsteemist teise, kas sellega seotud süsteemide vahel või erinevate süsteemide vahel. Kõrgtasemeline andmeviimistlus on andmeid üle kantakse kõrge kõrgusel ja selle tulemuseks on andmeid üle kantakse vähem. See on kõrgtasemeline andmeviimistlus.

###Võrgu tasemeline andmeviimistlus

Võrgu tasemeline andmeviimistlus on andmeid üle kantakse ühest süsteemist teise võrgu vahel. Võrgu tasemeline andmeviimistlus on andmeid üle kantakse võrku või võrgu teisele süsteemile.

###Kõrgekvaliteediline andmeviimistlus

Kõrgekvaliteediline andmeviimistlus on andmeid üle kantakse ühest süsteemist teise, kas sellega seotud süsteemide vahel või erinevate süsteemide vahel ning kõrge kvaliteediga. Kõrgekvaliteediline andmeviimistlus on eelisandmeviimistlus.

###Tarkvara tasemeline andmeviimistlus

Tarkvara tasemeline andmeviimistlus on andmeid üle kantakse ühest süsteemist teise, kas sellega seotud süsteemide vahel või erinevate süsteemide vahel ning tarkvaraga. Tarkvara tasemeline andmeviimistlus on täisvõimsuseline andmeviimistlus.

###Manuaalne andmeviimistlus

Manuaalne andmeviimistlus on andmeid üle kantakse ühest süsteemist teise, kas sellega seotud süsteemide vahel või erinevate süsteemide vahel ning manuaalselt. Manuaalne andmeviimistlus on eelisandmeviimistlus.

##Andmeviimistlemise käigus parandatavad probleemid

Andmeviimistlemise käigus parandatavad probleemid on:

- Andmete kvaliteedi parandamine;
- Andmete integriteedi parandamine;
- Andmete ühtlustamine;
- Andmete koondamine;
- Andmete säilitamine;
- Andmete ülekanne.

###Andmekvaliteedi kriteeriumid andmete viimistlemisel

Andmekvaliteedi kriteeriumid andmete viimistlemisel on:

- Õigesti ülekanne;
- Õigesti haldus;
- Õigesti integreerimine;
- Õigesti ühtlustamine;
- Õigesti koondamine;
- Õigesti säilitamine.

###Andmekvaliteedi eelised

Andmekvaliteedi eelised on:

- Andmete kvaliteedi parandamine;
- Andmete integriteedi parandamine;
- Andmete ühtlustamine;
- Andmete koondamine;
- Andmete säilitamine;
- Andmete ülekanne.

###Andmekvaliteedi puudused

Andmekvaliteedi puudused on:

- Andmete kvaliteedi halvenemine;
- Andmete integriteedi halvenemine;
- Andmete ühtlustamise puudumine;
- Andmete koondamise puudumine;
- Andmete säilitamise puudumine;
- Andmete ülekanne.

